tables.table_schema:
CREATE TABLE bid_spreads (
    id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    bid_price DECIMAL NOT NULL,
    ask_price DECIMAL NOT NULL
);

CREATE TABLE market_liquidity (
    id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    bid_volume INT NOT NULL,
    ask_volume INT NOT NULL
);

CREATE TABLE market_liquidity_analysis (
    id UUID PRIMARY KEY,
    symbol VARCHAR(50) NOT NULL,
    timestamp TIMESTAMP NOT NULL,
    liquidity_score DECIMAL NOT NULL
);

CREATE TABLE trading_volume_data (
    id UUID PRIMARY KEY,
    symbol VARCHAR(50) NOT NULL,
    timestamp TIMESTAMP NOT NULL,
    volume DECIMAL NOT NULL
);
